import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六辛日丙申时断</p><p>辛日生时遇丙申，月通金火转精神；</p><p>化成金水逢金地，聚福能为富贵人。</p><p>辛日丙申时，丙辛化水，申上长生。</p><p>若月通巳酉丑金气者，精神秀丽，文章聚福。</p><p>通火气旺、有倚托者，贵。</p><p>辛酉、辛未最妙，不成化象。</p><p>申上官星无气，平常衣禄。</p><p>辛丑日丙申时，化贵。</p><p>少年蹇剥，中贵显。</p><p>亥月，作化气看。</p><p>吉。</p><p>寅午戊巳未月，官星有气；春，财旺，俱吉。</p><p>辛卯日丙申时，化贵。</p><p>寅巳午未戌酉亥月，官星明朗，山明水秀，登科荣贵。</p><p>通士气，亦贵。</p><p>一云少蹇、中、末好。</p><p>辛巳日丙申时，见血则福；又云贵中失。</p><p>申未年月，身厚，妻重子孝，武职三品。</p><p>辛未日丙申时，因贵人门下得富。</p><p>春，清贵。</p><p>夏，平常。</p><p>秋，富。</p><p>冬，大贵寿促。</p><p>︽神白经︾云：金水乖合，又化水，主贵。</p><p>辛酉日丙申时，寅巳午戌月，官旺，荣贵。</p><p>︽神白经︾云：水化主贵。</p><p>辛亥日丙申时，发福，防孤克带疾。</p><p>通金气，主人秀丽福厚。</p><p>通水气，大贵。</p><p>辛日良时遇丙申，天元化合得其真；冬生若也无刑破。</p><p>贵显当登要路津。</p><p>辛日丙申时遇，长生禄马希奇。</p><p>天元化合显光辉，职重名高威势。</p><p>君子文章上立，常人荣旺家基。</p><p>生时真定却无亏，运喜西南东地。</p>",36),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","259卷 九·六辛日丙申时断.html.vue"]]);export{f as default};
